//fix browser modal error
Modal.setAppElement('#root')

function App() {
const auth=authentication.authentication
console.log(`Status Before: ${authentication.authentication.isLoggedin}`)
authentication.authentication.doLogin()
console.log(`Status After: ${authentication.authentication.isLoggedin}`)
  // const logInState=auth.state.isLoggedIn
  // auth.setAuth()
  // console.log(auth.state.isLoggedIn)
  return (
    <>

      <Router>
        {/*<Navbar />*/}
        <Switch>
          <Route exact path='/' component={Home} />
          <Route exact path='/about' component={About} />
          <Route exact path='/services' component={Services} />
          <Route exact path='/register' component={Register} />
          <Route exact path='/login' component={Login} />
          {/* <Route exact path='/dashboardUser' component={DashboardUser} />
          <Route exact path='/dashboardManager' component={DashboardManager} />
          <Route exact path='/dashboardCon' component={DashboardCon} /> */}
          {/* <Route exact path='/dashboardUser' component={logInState===false? () => <div>404 Page Not Found</div>: () => <DashboardUser />} /> */}
          <Route exact path='/dashboardUser' component={DashboardUser} />
          <Route exact path='/dashboardManager' component={DashboardManager} />
          <Route exact path='/dashboardCon' component={DashboardCon} />
          <Redirect to="/" />
        </Switch>
      </Router>

    </>
  );
}

export default App;


